import React from 'react'
import { useState } from 'react';
export default function AlbumViewSearchBar() {
  const [album, setAlbum] = useState("");
  function handleChange(event){
    setAlbum(event.target.value);
  }

  return (
    <div>
        <input className="" onChange={handleChange} name="search" placeholder="Search for an album..."></input>

    </div>
  )
}
